import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Domain.css";
const Domain = () => {
  const [selectedFile, setSelectedFile] = useState(null);

  const files = [
    
    { name: 'Mandatory Courses', type: 'word', path: 'https://hexawareonline.sharepoint.com/:w:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/1%20Mandatory%20Courses.docx?d=w7e851c1b8149450bb41858a8e9ed0f5e&csf=1&web=1&e=ZTYeFq' },
    { name: 'Medicaid 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/2%20Medicaid%20101.pptx?d=wd0fa339ce05442cd89d94ebf22d00f1a&csf=1&web=1&e=DWhFGe' },
    { name: 'HIE 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/3%20HIE%20101.pptx?d=w0bcf2f89479a4ed1aedfc8c861d1e441&csf=1&web=1&e=Femaa3' },
    { name: 'CCD 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/4%20CCD%20101.pptx?d=wb9ee7aa76b2a4a21ba0f7c6fcc954bc5&csf=1&web=1&e=Koy7j5' },
    { name: 'PBM 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/5%20PBM%20101.pptx?d=w5012c9b3dfc04a71b5bf536d108e8389&csf=1&web=1&e=DXbbS9' },
    { name: 'FHIR 101', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/6%20FHIR%20101.pptx?d=w99b9313d17254d14809df5dbd52a86e1&csf=1&web=1&e=u2xLlm' },
    { name: 'Fundamentals of Healthcare Payer Data & Analytics', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/02%20Domain%20Foundations/7%20Fundamentals%20of%20Healthcare%20Payer%20Data%20%26%20Analytics.pptx?d=we95210c0b6f4486381b4840511ffda10&csf=1&web=1&e=huNAf2' }
  ]

  const handleFileDisplay = (path) => {
    // window.open(path, '_blank');
    window.location.href = path;
  };

  return (
    <div className="container">
      <div className="buttons-container">
        {files.map((file, index) => (
          <button key={index} className="button" onClick={() => handleFileDisplay(file.path)}>
            {file.name}
          </button>
        ))}
      </div>
      {selectedFile && (
        <div className="file-container">
          {/* Display the selected file based on its type */}
          {selectedFile.endsWith('.png') && <img className="file-display" src={selectedFile} alt="File" />}
          {selectedFile.endsWith('.pptx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.pdf') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.docx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.xlsx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.video') && (
            <video className="file-display" src={selectedFile} controls>
              Your browser does not support the video tag.
            </video>
          )}
        </div>
      )}
    </div>
  );
};

export default Domain;
